    return (
        <div>
            <Header
                title="Избранное"
                description="Ваши любимые произведения находятся здесь!"
            />
            <Card
                term = {d => d.isFavorite === true}
                route=""  
            />
            <Footer/>
        </div>
    );
};

export default Favorites
